VALUES ('3287370002668', 'Paella', 'Pa\' de la Plat culte de la cuisine espagnole, la paëlla fait partie des recettes préparées de long Il faut dire que la tentation est forte, avec une gastronomie espagnole qui déploie Dans notre recette de Paëlla de la Mer, voUs retrouverez la diversité des ingrédients pois, poivrons ... une vraie fiesta de couleurs et de sensations ! INGRÉDIENTS (0% mis en Œuvre) : Riz pré-cuit 33,3% (jus de cuisson, riz, poivrons rouges et verts, huile de tournesol, chorizo, huile olive), poissons blancs (poisson qualité sans arêtes), fumet de cuisson (eau, filetage de poissons blancs, fumet de crustacés (maltodextrine de pomme de terre, sel, poudre de crustacés, tomate déshydratée, arômes naturels, plantes aromatiques, poudre d\'algue, épices), concentré de tomates, sel, ail, oignon, pimenton, curcuma, poivre)), moules du Pacifique 7,3%, calamars 5% (calamars, acidifiant, sel), crevettes entières cuites (crevettes, sel, disulfites de sodium), chorizo (viande de porc, paprika, sel, lactose, ail, dextrose, épices, antioxydant : ascorbate de sodium, conservateurs : nitrite de sodium et potassium), petits pois 1,1%. Traces éventuelles de gluten. QUALITÉ SANS ARÊTE : malgré tout le soin apporté à la préparation de nos poissons, la présence exceptionnelle d\'arête n\'est jamais exclue.', 'https://static.openfoodfacts.org/images/products/328/737/000/2668/front_fr.4.400.jpg', '3.6', '0.8', '13.8', '0.8', '', '9.7', '0.9', '0.354330708661417', '', '1');

